import{_ as e,c as i,o as s,ag as o}from"./chunks/framework.DsLRI4XI.js";const p=JSON.parse('{"title":"FAQ","description":"","frontmatter":{},"headers":[],"relativePath":"guide/faq.md","filePath":"guide/faq.md","lastUpdated":1765442147000}'),t={name:"guide/faq.md"};function r(n,a,l,h,c,d){return s(),i("div",null,[...a[0]||(a[0]=[o('<h1 id="faq" tabindex="-1">FAQ <a class="header-anchor" href="#faq" aria-label="Permalink to &quot;FAQ&quot;">​</a></h1><h2 id="general-questions" tabindex="-1">General Questions <a class="header-anchor" href="#general-questions" aria-label="Permalink to &quot;General Questions&quot;">​</a></h2><h3 id="what-is-nicasa" tabindex="-1">What is Nicasa? <a class="header-anchor" href="#what-is-nicasa" aria-label="Permalink to &quot;What is Nicasa?&quot;">​</a></h3><p>Nicasa is a modern desktop application for viewing and managing image collections. It provides a smooth, intuitive interface for browsing photos and digital images.</p><h3 id="is-nicasa-free" tabindex="-1">Is Nicasa free? <a class="header-anchor" href="#is-nicasa-free" aria-label="Permalink to &quot;Is Nicasa free?&quot;">​</a></h3><p>Yes, Nicasa is free to download and use. It&#39;s an open-source project.</p><h3 id="which-operating-systems-are-supported" tabindex="-1">Which operating systems are supported? <a class="header-anchor" href="#which-operating-systems-are-supported" aria-label="Permalink to &quot;Which operating systems are supported?&quot;">​</a></h3><p>Nicasa supports Windows 10+, macOS 10.15+, and Linux distributions like Ubuntu 18.04+.</p><h3 id="how-do-i-update-nicasa" tabindex="-1">How do I update Nicasa? <a class="header-anchor" href="#how-do-i-update-nicasa" aria-label="Permalink to &quot;How do I update Nicasa?&quot;">​</a></h3><p>The application will notify you when updates are available. You can also check for updates manually through Help &gt; Check for Updates.</p><h2 id="usage-questions" tabindex="-1">Usage Questions <a class="header-anchor" href="#usage-questions" aria-label="Permalink to &quot;Usage Questions&quot;">​</a></h2><h3 id="how-do-i-open-multiple-folders" tabindex="-1">How do I open multiple folders? <a class="header-anchor" href="#how-do-i-open-multiple-folders" aria-label="Permalink to &quot;How do I open multiple folders?&quot;">​</a></h3><p>Currently, Nicasa works with one folder at a time. You can switch between folders using File &gt; Open Folder.</p><h3 id="can-i-edit-images-in-nicasa" tabindex="-1">Can I edit images in Nicasa? <a class="header-anchor" href="#can-i-edit-images-in-nicasa" aria-label="Permalink to &quot;Can I edit images in Nicasa?&quot;">​</a></h3><p>Nicasa provides basic editing features like rotation and flipping. For advanced editing, we recommend using dedicated image editing software.</p><h3 id="does-nicasa-support-raw-files" tabindex="-1">Does Nicasa support RAW files? <a class="header-anchor" href="#does-nicasa-support-raw-files" aria-label="Permalink to &quot;Does Nicasa support RAW files?&quot;">​</a></h3><p>Not currently, but this is planned for a future release. For now, RAW files need to be converted to standard formats.</p><h3 id="how-do-i-create-a-slideshow" tabindex="-1">How do I create a slideshow? <a class="header-anchor" href="#how-do-i-create-a-slideshow" aria-label="Permalink to &quot;How do I create a slideshow?&quot;">​</a></h3><p>Use View &gt; Slideshow or press F5. You can configure slideshow settings in Preferences.</p><h2 id="technical-questions" tabindex="-1">Technical Questions <a class="header-anchor" href="#technical-questions" aria-label="Permalink to &quot;Technical Questions&quot;">​</a></h2><h3 id="why-are-thumbnails-not-showing" tabindex="-1">Why are thumbnails not showing? <a class="header-anchor" href="#why-are-thumbnails-not-showing" aria-label="Permalink to &quot;Why are thumbnails not showing?&quot;">​</a></h3><p>This could be due to file permissions, corrupted files, or unsupported formats. Try the solutions in our <a href="./troubleshooting.html">Troubleshooting guide</a>.</p><h3 id="can-i-change-the-interface-language" tabindex="-1">Can I change the interface language? <a class="header-anchor" href="#can-i-change-the-interface-language" aria-label="Permalink to &quot;Can I change the interface language?&quot;">​</a></h3><p>Language support is planned for future versions. Currently, Nicasa uses your system language where possible.</p><h3 id="how-do-i-backup-my-settings" tabindex="-1">How do I backup my settings? <a class="header-anchor" href="#how-do-i-backup-my-settings" aria-label="Permalink to &quot;How do I backup my settings?&quot;">​</a></h3><p>Settings are stored in the application data folder. Copy this folder to backup your preferences.</p><h3 id="is-there-a-portable-version" tabindex="-1">Is there a portable version? <a class="header-anchor" href="#is-there-a-portable-version" aria-label="Permalink to &quot;Is there a portable version?&quot;">​</a></h3><p>A portable version is available for Windows. Download it from our website.</p><h2 id="development-questions" tabindex="-1">Development Questions <a class="header-anchor" href="#development-questions" aria-label="Permalink to &quot;Development Questions&quot;">​</a></h2><h3 id="can-i-contribute-to-nicasa" tabindex="-1">Can I contribute to Nicasa? <a class="header-anchor" href="#can-i-contribute-to-nicasa" aria-label="Permalink to &quot;Can I contribute to Nicasa?&quot;">​</a></h3><p>Yes! Nicasa is open source. Visit our <a href="https://github.com/nicasa-project/nicasa" target="_blank" rel="noreferrer">GitHub repository</a> to contribute code, report issues, or suggest features.</p><h3 id="how-do-i-build-nicasa-from-source" tabindex="-1">How do I build Nicasa from source? <a class="header-anchor" href="#how-do-i-build-nicasa-from-source" aria-label="Permalink to &quot;How do I build Nicasa from source?&quot;">​</a></h3><p>See our developer documentation on GitHub for build instructions.</p><h3 id="what-technologies-does-nicasa-use" tabindex="-1">What technologies does Nicasa use? <a class="header-anchor" href="#what-technologies-does-nicasa-use" aria-label="Permalink to &quot;What technologies does Nicasa use?&quot;">​</a></h3><p>Nicasa is built with modern web technologies including Electron for the desktop wrapper and Vue.js for the interface.</p><h2 id="privacy-questions" tabindex="-1">Privacy Questions <a class="header-anchor" href="#privacy-questions" aria-label="Permalink to &quot;Privacy Questions&quot;">​</a></h2><h3 id="does-nicasa-collect-any-data" tabindex="-1">Does Nicasa collect any data? <a class="header-anchor" href="#does-nicasa-collect-any-data" aria-label="Permalink to &quot;Does Nicasa collect any data?&quot;">​</a></h3><p>No, Nicasa does not collect or transmit any personal data. All image processing happens locally on your device.</p><h3 id="are-my-images-safe" tabindex="-1">Are my images safe? <a class="header-anchor" href="#are-my-images-safe" aria-label="Permalink to &quot;Are my images safe?&quot;">​</a></h3><p>Yes, Nicasa only accesses images you explicitly open. It doesn&#39;t upload or share your files.</p><h3 id="what-permissions-does-nicasa-need" tabindex="-1">What permissions does Nicasa need? <a class="header-anchor" href="#what-permissions-does-nicasa-need" aria-label="Permalink to &quot;What permissions does Nicasa need?&quot;">​</a></h3><p>Nicasa needs access to your file system to read images and save settings. It doesn&#39;t require internet access to function.</p><h2 id="still-have-questions" tabindex="-1">Still Have Questions? <a class="header-anchor" href="#still-have-questions" aria-label="Permalink to &quot;Still Have Questions?&quot;">​</a></h2><p>If you can&#39;t find the answer here, please:</p><ol><li>Check our <a href="./../">full documentation</a></li><li>Search our <a href="https://github.com/nicasa-project/nicasa-support/issues" target="_blank" rel="noreferrer">GitHub issues</a></li><li>Create a new issue if needed</li></ol><p>We&#39;re here to help!</p>',46)])])}const f=e(t,[["render",r]]);export{p as __pageData,f as default};
